import React, { useState, useEffect } from "react";
import { BrowserRouter as Router } from 'react-router-dom';
import { UserRes, UsersType } from './type/UserType'

import styles from './App.module.css'

import APIGetUsers from "./api/APIGetUsers";

import Card from './components/Card'

const App: React.FC = () => {

  const [users, setUsers]: Array<any> = useState([])

  useEffect(() => {
    APIGetUsers()
      .then((res: UserRes) => setUsers(res.data))
      .catch((err) => console.log(err))
  })

  const CardItems = users.map((e: UsersType, i: number) => {
    return (
      <Router>
        <React.Fragment key={i}>
          <Card name={e.name}
            nickname={e.username}
            website={e.website}
            id={e.id}
          />
        </React.Fragment>
      </Router>
    )
  })

  return (
    <div className={styles.container}>
      {CardItems}
    </div>
  )
}

export default App;
